import React,{Component} from 'react';
class Landingcontent extends React.Component{
	constructor(props){
		super(props)

	}
	render(){
		return(
			<div>
			<div className="main1">
				<div className="c1">
					
				</div>
				<div className="c2">
				</div>

				<div className="c3">

				</div>
			</div>

			
			<style jsx>{`
				.main1{

					display:flex;
					flex-direction:row;
					background:black;
					height:500px;
					margin-top:80px;
					align-items:center;
					justify-content:space-around;
					flex-wrap: wrap;


				}
				.c1{
					display:flex;
					flex-basis:20%;
					background:white;
					height:70%;
					width:200px;
				}
				.c2{
					display:flex;
					flex-basis:20%;
					background:white;
					height:70%;
				}
				.c3{
					display:flex;
					flex-basis:20%;
					background:white;
					height:70%;
				}
				`}</style>

			</div>

		)
	}
}
export default Landingcontent
